import React, { useEffect, useState } from 'react';
import api from '../../api';

export default function MyProjects() {
  const [projects, setProjects] = useState([]);
  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) return;
    api.get('/api/projects/my', {
      headers: { Authorization: `Bearer ${token}` }
    }).then(res => setProjects(res.data));
  }, []);

  const selectFreelancer = async (projectId, freelancerId) => {
    try {
      await api.post(`/projects/${projectId}/select`, { freelancerId }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      alert('Freelancer selected!');
      // Refresh projects
      const res = await api.get('/projects/my', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProjects(res.data);
    } catch (err) {
      alert(err.response?.data?.msg || 'Error selecting');
    }
  };

  const handleFeedbackSubmit = async (e, projectId) => {
    e.preventDefault();
    const message = e.target.message.value;
    const rating = e.target.rating.value;

    try {
      await api.post(`/projects/${projectId}/feedback`, { message, rating }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      alert('Feedback submitted');
      const res = await api.get('/projects/my', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setProjects(res.data);
    } catch (err) {
      alert(err.response?.data?.msg || 'Error submitting feedback');
    }
  };

  return (
    <div className="container mt-4">
      <h2>My Posted Projects</h2>
      {projects.map(p => (
        <div key={p._id} className="card my-3 p-3">
          <h4>{p.title}</h4>
          <p>{p.description}</p>
          <h5>Bids:</h5>
          {p.bids.length === 0 && <p>No bids yet.</p>}
          {p.bids.map(bid => (
            <div key={bid._id} className="mb-2">
              <strong>{bid.freelancer?.name}</strong> - ₹{bid.amount}
              <p>{bid.message}</p>
              {!p.selectedFreelancer && (
                <button className="btn btn-sm btn-success"
                  onClick={() => selectFreelancer(p._id, bid.freelancer._id)}>
                  Select this Freelancer
                </button>
              )}
            </div>
          ))}

          {p.isSubmitted && (
            <div className="alert alert-info mt-3">
              <strong>Submission:</strong> {p.submission}
            </div>
          )}

          {/* Show feedback form if work is submitted and no feedback yet */}
          {p.isSubmitted && !p.feedback && (
            <form onSubmit={(e) => handleFeedbackSubmit(e, p._id)} className="mt-3">
              <textarea name="message" className="form-control my-2" placeholder="Feedback message" required />
              <select name="rating" className="form-control my-2" required>
                <option value="">Select Rating</option>
                {[1, 2, 3, 4, 5].map(r => (
                  <option key={r} value={r}>{r} Star</option>
                ))}
              </select>
              <button className="btn btn-primary">Submit Feedback</button>
            </form>
          )}

          {p.feedback && (
            <div className="mt-2">
              <strong>Feedback Given:</strong>
              <p>{p.feedback.message}</p>
              <p>Rating: {'★'.repeat(p.feedback.rating)}{'☆'.repeat(5 - p.feedback.rating)}</p>
            </div>
          )}
        </div>
      ))}
    </div>
  );
}
